var domain=document.getElementById("domain").getAttribute("value");var redirect=document.getElementById("redirect").getAttribute("value");console.log(redirect);function signOut(){var a=gapi.auth2.getAuthInstance();a.signOut().then(function(){console.log("User signed out.")})}function onSignIn(b){var c=b.getAuthResponse().id_token;var a=new XMLHttpRequest();a.open("POST",domain+"/auth/google");a.setRequestHeader("Content-Type","application/x-www-form-urlencoded");a.onload=function(){};a.send("id_token="+c)}function checkStatus(){document.getElementById("notice").innerHTML="Checking...";var a=new XMLHttpRequest();a.open("GET",domain+"/auth/status");a.setRequestHeader("Content-Type","application/x-www-form-urlencoded");a.onreadystatechange=function(){if(this.readyState==4){if(this.status==200){document.getElementById("notice").innerHTML="You Are Authorized";return true}else{if(this.status==401){document.getElementById("notice").innerHTML="You Are Still Not Authorized"}else{document.getElementById("notice").innerHTML="Something Unexpected Happened"}}}else{if(this.readyState==1||this.readyState==2||this.readyState==3){document.getElementById("notice").innerHTML="Checking Status..."}}};a.send()}function recaptchaCallback(){document.getElementById("recaptcha_check_empty").value=1;var a=grecaptcha.getResponse();var b=new XMLHttpRequest();b.open("POST",domain+"/auth/recaptcha");b.setRequestHeader("Content-Type","application/x-www-form-urlencoded");b.onload=function(){var d=setTimeout(checkStatusHidden(),2000);if(d){var c=document.getElementById("recaptcha-form");c.parentNode.removeChild(c);if(redirect!=null){window.location.replace(domain+redirect)}}};b.send("data="+a)}function checkStatusHidden(){var b=new XMLHttpRequest();b.open("GET",domain+"/auth/status");b.setRequestHeader("Content-Type","application/x-www-form-urlencoded");b.onreadystatechange=function(){if(this.readyState==4){if(this.status==200){return true}else{if(this.status==401){return false}else{return false}}}};try{b.send()}catch(a){}finally{}};